import { Grid } from "@mui/material";
import React from "react";

const contents = [];

function Home(){

    return(
      <Grid container>
        <Grid item>
        </Grid>
        <Grid item>
        </Grid>
        {contents.map( (content , index) =>
        <Box key={index}> content </Box>
        ) }
      </Grid>
    );

}

export default Home;
